    IncioComponent.prototype.timeConversion = function (seconds) {
        console.log("Seconds", seconds);
        var msg = "";
        var d = Math.floor(seconds / (24 * 3600));
        seconds -= d * (24 * 3600);
        if (d > 0) {
            msg += d + " days ";
        }
        var h = Math.floor(seconds / 3600);
        if (h > 0) {
            msg += (h < 10 ? "0" + h : h) + " hours ";
        }
        seconds -= h * 3600;
        var m = Math.floor(seconds / 60);
        if (m > 0) {
            msg += (m < 10 ? "0" + m : m) + " min ";
        }
        seconds -= m * 60;
        if (seconds > 0) {
            msg += (Math.floor(seconds) < 10 ? "0" + Math.floor(seconds) : Math.floor(seconds)) + " sec";
        }
        return msg;
    };
